(1, '&lt;!-- [if gte mso 9]&gt;&lt;xml&gt;\r\n &lt;o:OfficeDocumentSettings&gt;\r\n  &lt;o:AllowPNG/&gt;\r\n &lt;/o:OfficeDocumentSettings&gt;\r\n&lt;/xml&gt;&lt;![endif]--&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;Perhatikan program berikut :&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;/ * PROGRAM lebih_besar */&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: .0001pt; line-height: normal;&quot;&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;/&lt;em style=&quot;mso-bidi-font-style: normal;&quot;&gt;* mencetak pesan &amp;ldquo;angka pertama lebih besar dari angka kedua&amp;rdquo; atau &amp;ldquo;angka kedua lebih besar dari angka pertama&amp;rdquo; &lt;/em&gt;*/&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;#&lt;strong style=&quot;mso-bidi-font-weight: normal;&quot;&gt;include&lt;/strong&gt;&amp;lt;stdio.h&amp;gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong style=&quot;mso-bidi-font-weight: normal;&quot;&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;main&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;(){&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; /* DEKLARASI */&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;strong style=&quot;mso-bidi-font-weight: normal;&quot;&gt;int&lt;/strong&gt; angka_pertama, angka_kedua;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; /* ALGORITMA */&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; angka_pertama = ...... ;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; angka_kedua = ...... ;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;strong style=&quot;mso-bidi-font-weight: normal;&quot;&gt;if&lt;/strong&gt; (angka_pertama ...... angka kedua)&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 10.0pt; font-family: ''Times New Roman'',serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: IN;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;strong style=&quot;mso-bidi-font-weight: normal;&quot;&gt;printf&lt